import { Box, Typography } from '@mui/material'
import React from 'react'

const Movie = () => {
  return (
   <Box margin={"auto"} marginTop={4}>
    <Typography variant='h4' padding={2} textAlign="center">All Movies</Typography>
   </Box>
  )
}

export default Movie
